scriptlet.script:
try {
	if(Iteration  < Max) {
		scriptletResponse="sleep";
		scriptletContext.put("Iteration",Iteration++);
	}
	else {
		scriptletResponse="failure";
		scriptletContext.put("FailureMessage","Timeout: " + FailureMessage);
	}
}
catch(e) {
	scriptletContext.put("FailureMessage",e.stack);
	scriptletResponse = "failure";
}

staticBinding.value:
expectendswith ${prompt}
send ${step1}
expectendswith ${prompt}
send ${step2}
expectendswith ${prompt}
send ${step3}
expectendswith ${prompt}
send exit

